import React from 'react';
import { TextInput } from './TextInput';

export const Article = ({ registration }) => {
    if (registration)
        return (
            <form>
                
                <input>Número de artículo</input>
                <input>Precio por unidad</input>
                <input>Descripción</input>
            </form>
        );
    else
        return (
            <form>
                <input>Número de artículo</input>
            </form>
        );
}
